export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Join Event" button to be visible and click it
    await page.waitForSelector('button.btn.btn-secondary.btn-large');
    await page.click('button.btn.btn-secondary.btn-large');

    // Wait for the modal to appear and fill in the event code
    await page.waitForSelector('#eventCode');
    await page.type('#eventCode', 'example_event_code');

    // Take a screenshot of the modal with the event code
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_event_code.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_event_code.png'));

    // Click the "Join Event" button in the modal
    await page.waitForSelector('button.btn.btn-primary');
    await page.click('button.btn.btn-primary');

    // Wait for the events to load and extract metadata
    await page.waitForSelector('.event-details'); // Adjust selector based on actual event details
    const events = await page.$$eval('.event-details', eventElements => {
      return eventElements.map(event => {
        const date = event.querySelector('.event-date').innerText; // Adjust selector
        const participants = Array.from(event.querySelectorAll('.participant')).map(p => p.innerText); // Adjust selector
        const internalId = event.getAttribute('data-id'); // Adjust based on how ID is stored
        return { date, participants, internalId };
      });
    });

    // Take a screenshot of the loaded events
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_loaded_events.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_loaded_events.png'));

    return {
      success: true,
      action: "Extracted event metadata successfully",
      extractedData: { events },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

